import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and focus it
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    const searchInput = await page.$('#searchInput');
    await searchInput.click();

    // Type a partial search term to trigger autocomplete (e.g., 'iph')
    await searchInput.type('iph');

    // Wait for the suggestions dropdown to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions.png'));

    // Extract suggestion texts
    const suggestionItems = await page.$$eval('.suggestion-item', els => els.map(e => e.textContent.trim()));

    // Click the first suggestion
    if (suggestionItems.length > 0) {
      await page.click('.suggestion-item');
    }

    // Wait for the search results to appear (look for "Search Results" heading)
    await page.waitForSelector('text=Search Results', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_results.png'));

    // Extract the heading and number of results
    const heading = await page.$eval('.search-results h2', el => el.textContent.trim());
    const resultsCount = await page.$eval('.results-count', el => el.textContent.trim());

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, selected a suggestion, and verified search results.",
      extractedData: {
        suggestions: suggestionItems,
        resultsHeading: heading,
        resultsCount: resultsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
